INSERT INTO `table_questoes` (`id`, `index_area`, `materia`, `dificuldade`, `questao`, `alt1`, `alt2`, `alt3`, `alt4`, `alt5`, `alt_correta`, `img`) VALUES
(99, 2, 17, 2, '(PUC-RS) Responda à questão com base nas informações e afirmativas a seguir. A febre amarela é uma doença infecciosa causada por um vírus transmitido por mosquitos. Ela possui dois tipos: a febre amarela urbana, erradicada do Brasil por volta da década de 1960, e a febre amarela silvestre. Os agentes responsáveis pela transmissão da forma silvestre são mosquitos dos gêneros Haemagogus e Sabethes, enquanto a forma urbana dessa doença pode ser transmitida pelo mosquito Aedes aegypti. A febre amarela silvestre já provocou a morte de algumas pessoas e de muitos bugios em uma extensa área do Rio Grande do Sul desde o final de 2008. Ao contrário da maioria das pessoas, os bugios são extremamente sensíveis à doença, morrendo poucos dias após contraí-la. (Adaptado de Bicca-Marques) A propósito do tema, é possível afirmar: I. A morte de bugios por febre amarela pode alertar os órgãos de saúde sobre a circulação do vírus em determinada região. II. Mosquitos dos gêneros Haemagogus e Sabethes são hospedeiros da febre amarela. III. A febre amarela pode ser reintroduzida nas áreas urbanas com presença do dengue. IV. A presença de bugios representa perigo, pois são vetores da forma silvestre da febre amarela. Estão corretas apenas as afirmativas', 'A) I e II.', 'B) I e III.', 'C) I e IV.', 'D) II e III.', 'E) II e IV.', 2, NULL),
(100, 3, 20, 2, '(TRT, 2012) Sobre Programação Orientada a Objetos,\r\nanalise:\r\nI. O encapsulamento garante que apenas as interfaces\r\nnecessárias para interação com o objeto estejam visíveis,\r\ne atributos internos não sejam acessíveis.\r\nII. O polimorfismo garante que objetos possam herdar\r\nmétodos e atributos de uma superclasse para a geração\r\nde uma nova classe.\r\nIII. A herança possibilita que distintas operações na\r\nmesma classe tenham o mesmo nome, desde que\r\nalterada a assinatura.\r\nEstá correto o que se afirma em', 'A)III, apenas.\r\n ', 'B)II, apenas.\r\n ', 'C)I, apenas. ', 'D)II e III, apenas ', 'E)I, II e III. ', 3, NULL),
(101, 4, 28, 2, '(Concurso Público Assistente Técnico em Tecnologia da Informação de Defensoria Assistente Técnico de Suporte, 2018) Os computadores utilizam diversos\r\ntipos de memória, cada uma com características próprias, que permitem o armazenamento dos dados que eles manipulam. Considerando que um computador possua os seguintes tipos de memória:\r\nMemória Cache, Memória Principal e Disco Rígido, elas poderiam ser classificadas de diversas formas, como o custo por bit. A classificação da memória, indo do\r\nmenor custo para a de maior custo por bit é:', 'A)Disco Rígido, Memória Cache, Memória Principal.  ', 'B)Memória Cache, Disco Rígido, Memória Principal. ', 'C)Disco Rígido, Memória Principal, Memória Cache. ', 'D)Memória Principal, Disco Rígido, Memória Cache.  ', 'E) Memória Principal, Memória Cache, Disco Rígido.\r\n', 3, NULL),
(102, 4, 32, 1, '(CESGRANRIO, 2012) Considere as etapas abaixo.\r\n1. O cliente envia um SYN para o servidor.\r\n2. O servidor responde com um SYN-ACK ao cliente.\r\n3. O cliente envia um ACK de volta ao servidor.\r\nEmbora estejam simplificadas, estas etapas fazem\r\nparte do estabelecimento de uma conexão entre\r\ncliente e servidor, usando um processo conhecido\r\ncomo three-way handshake, por meio do protocolo:\r\n', 'A) IP', 'B) FTP', 'C) UDP', 'D) HTTP', 'E) TCP', 5, NULL),
(103, 4, 29, 2, '(INAZ-CFF-Programador, 2017) O Processo Unificado da Rational conhecido como RUP, é um processo de engenharia de software criado para apoiar o\r\ndesenvolvimento orientado a objetos, fornecendo uma forma sistemática para se obter vantagens no uso da UML. Sendo assim, assinale em que fase de processo ocorre o\r\ntreinamento de usuários? ', 'Manutenção. ', 'Concepção. ', 'Transição. ', 'Construção  ', 'Elaboração', 3, NULL),
(104, 2, 16, 1, '. Mário comprou uma casa por $175.000,00. Para o pagamento foi dada uma entrada de $145.000,00 e o restante parcelado a juros simples com taxa de 12% ao\r\nano durante 5 anos. Qual é o valor total dos juros?', '$18.000,00', '$36.000,00', '$16.000,00', '$24.000,00', '$10.000,00', 1, NULL),
(105, 4, 30, 3, '(FCC-Analista de Sistemas, 2018) Considere que uma equipe de Analistas de Sistemas da Defensoria está trabalhando em um projeto com base no RUP (Rational\r\nUnified Process). Eles estão atuando em uma atividade cujo objetivo é descrever o que o sistema deve fazer, permitindo que desenvolvedores e clientes opinem na\r\ndescrição. Um documento visual, na forma de use cases (caso de uso), é criado, no qual os atores representam os usuários e outros sistemas com os quais o sistema em\r\ndesenvolvimento irá interagir. Os use cases são descritos em detalhes, mostrando como o sistema interage com os atores e o que faz nestas interações. Os Analistas estão\r\ntrabalhando na:', 'Fase de Transição ', 'Disciplina de Elaboração', 'Fase de Análise e Design', 'Disciplina de Requisitos', 'Disciplina de Gerência de Projeto', 4, NULL),
(106, 3, 20, 2, '.(TRT, 2012) Sobre Programação Orientada a Objetos,\r\nanalise:\r\nI. O encapsulamento garante que apenas as interfaces\r\nnecessárias para interação com o objeto estejam visíveis,\r\ne atributos internos não sejam acessíveis.\r\nII. O polimorfismo garante que objetos possam herdar\r\nmétodos e atributos de uma superclasse para a geração\r\nde uma nova classe.\r\nIII. A herança possibilita que distintas operações na\r\nmesma classe tenham o mesmo nome, desde que\r\nalterada a assinatura.\r\nEstá correto o que se afirma em', 'III, apenas.', 'II, apenas.', 'I, apenas.', 'II e III, apenas.', 'I, II e III.', 3, NULL),
(107, 3, 19, 2, '(FGV, 2018) Expressões lógicas são frequentemente\r\nutilizadas em linguagens de programação. Por\r\nexemplo, um comando if com a expressão\r\nif ( ! (A && B) )\r\npode ser reescrito, para quaisquer valores lógicos de A\r\ne B, com a expressão:', 'A || B', '!A || B', '!( !A || !B)', 'A && B', '!A || !B', 5, NULL),
(108, 2, 16, 1, 'Um vendedor de assinaturas de TV a cabo teve, nos 7\r\nprimeiros meses do ano, uma média mensal de 84\r\nassinaturas vendidas. Devido a uma reestruturação da\r\nempresa, foi exigido que todos os vendedores tivessem,\r\nao final do ano, uma média mensal de 99 assinaturas\r\nvendidas. Diante disso, o vendedor se viu forçado a\r\naumentar sua média mensal de vendas nos 5 meses\r\nrestantes do ano. Qual deverá ser a média mensal de\r\nvendas do vendedor, nos próximos 5 meses, para que ele\r\npossa cumprir a exigência da sua empresa?\r\n', '91', '105', '114', '118	', '120', 5, NULL),
(109, 4, 28, 2, '(FCC – DPE/SP, 2009) Para o processo de gravação e leitura\r\ndos dados em um disco rígido, a superfície de uma face do\r\ndisco é dividida fisicamente em ', 'setores e partições', 'partições e clusters.', 'trilhas e partições.', 'trilhas e setores.', 'setores e cilindros', 4, NULL),
(110, 3, 20, 2, '(Fundação CASA – Desenvolvimento de Sistemas, 2014) Quanto ao C#, assinale a alternativa correta.', 'Bibliotecas e serviços o requerem um método Main como\r\num ponto de entrada', 'Uma aplicação não pode ter mais de uma classe com um método Main.', 'Um método Main não pode ser declarado dentro de uma\r\nclasse', 'Um método Main só pode conter os tipos de retorno: void ou String. ', 'Um método Main pode ser declarado com um parâmetro string[].', 5, NULL),
(111, 2, 13, 1, 'teste 1\r\n\r\nvalido\r\nnao valido', 'a', 'b', 'c', 'd', 'e', 0, '');

